import React from 'react';
function Cards(srcImage,title,typeTrend){
    return (
        <div class="card"  style={{display:'inline-block'}}>
        <img src={srcImage} alt={typeTrend} style={{width:'200px'}}/>
        <div class="container">
            <h4><b>{title}</b></h4> 
            <p>{typeTrend}</p> 
        </div>
        </div>
    )
}

export default Cards;
